import Link from 'next/link';

const Index = () => (
    <React.Fragment>
    <div>
        <ul>
            <li> <Link href="/"> <a>Home</a> </Link> </li>
            <li> <Link href="/about"> <a>About</a> </Link> </li>
        </ul>
        <h1>Welcome to BitzPrice</h1>
    </div>
       </React.Fragment>
)

export default Index;
